// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.8.0;

import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./FundManager.sol";
import "./IRegistry.sol";
import "./JuniorToken.sol";
import "./JuniorInvestPool.sol";
import "./JuniorInvestPoolReward.sol";
import "./SeniorToken.sol";
import "./SeniorInvestPool.sol";
import "./SeniorInvestPoolReward.sol";
import "./SkyrimToken.sol";
import "./IInvestMarket.sol";
import "./SkyrimInvestMarket.sol";


contract Skyrim is Ownable, FundManager, ReentrancyGuard {
    using SafeERC20 for SeniorToken;
     using SafeERC20 for JuniorToken;
    using SafeERC20 for IERC20;
    // using Address for address;
    using SafeMath for uint;

    // keccak256 hash of "Skyrim.handler.registry"
    bytes32 private constant HANDLER_REGISTRY = 0x6874162fd62902201ea0f4bf541086067b3b88bd802fac9e150fd2d1db584e19;

    IERC20 public _DAIToken = IERC20(0xaD6D458402F60fD3Bd25163575031ACDce07538D); //TODO change to mainnet address

    address FundManagerAddress = address(0xce59a6b3f4c5B3Da0d73A186032BbB58cb576264); //TODO change to fund manager address

    SkyrimToken _TRAToken;
    SeniorToken _STToken;
    JuniorToken _JTToken; 
    SkyrimInvestMarket _investMarket;

    address _STPool;
    JuniorInvestPool _JTInvestPool;
    JuniorInvestPoolReward _JTInvestPoolReward;
    SeniorInvestPool _STInvestPool;
    SeniorInvestPoolReward _STInvestPoolReward;
    address _pollLiquitidyReward;


    // User deposit data
    // Each deposit has an ID used in the depositNFT, which is equal to its index in `deposits` plus 1
    struct InvestByJTInfo {
        uint256 amount; // Amount of stablecoin deposited
        bool active; // True if not yet withdrawn, false if withdrawn
        bool finalSurplusIsNegative;
        uint256 finalSurplusAmount; // Surplus remaining after withdrawal
        uint256 investTimestamp; // Unix timestamp at time of deposit, in seconds
    }
    InvestByJTInfo[] internal investByJTInfos;

    struct InvestBySTInfo {
        uint256 amount; // Amount of stablecoin deposited
        bool active; // True if not yet withdrawn, false if withdrawn
        bool finalSurplusIsNegative;
        uint256 finalSurplusAmount; // Surplus remaining after withdrawal
        uint256 investTimestamp; // Unix timestamp at time of deposit, in seconds
    }

    InvestBySTInfo[] internal investBySTInfos;

    uint256 _totalInvestByJT;
    uint256 _totalInvestByST;

    uint256 public MinInvestBySTAmount; // Minimum invest by ST amount for each invest, in stablecoins
    uint256 public MaxInvestBySTAmount; // Maximum invest by ST amount for each invest, in stablecoins

    uint256 public MinInvestByJTAmount; // Minimum invest by JT amount for each invest, in stablecoins
    uint256 public MaxInvestByJTAmount; // Maximum invest by JT amount for each invest, in stablecoins

    mapping(string => address) private _investProductWhiteList; 

    // Events
    event EInvestByST(
        address indexed sender,
        uint256 indexed depositID,
        uint256 amount
    );

    event EInvestByJT(
        address indexed sender,
        uint256 indexed depositID,
        uint256 amount
    );

    event EWithdraw(
        address indexed sender,
        uint256 indexed depositID,
        uint256 indexed fundingID,
        bool early,
        uint256 takeBackMPHAmount
    );

    uint private unlocked = 1;

    modifier lock() {
        require(unlocked == 1, 'SeniorToken: LOCKED');
        unlocked = 0;
        _;
        unlocked = 1;
    }

    constructor (address TRAToken_, address STToken_, address JTToken_, address investMarket_, address JTInvestPoolReward_) payable {
        _TRAToken = SkyrimToken(TRAToken_);
        _STToken = SeniorToken(STToken_);
        _JTToken = JuniorToken(JTToken_);
        _investMarket = SkyrimInvestMarket(investMarket_);
        _JTInvestPoolReward = JuniorInvestPoolReward(JTInvestPoolReward_);
    }

    /// @notice Get the registry contract address.
    function _getRegistry() internal view returns (address registry) {
        bytes32 slot = HANDLER_REGISTRY;
        assembly {
            registry := sload(slot)
        }
    }

    /// @notice Check if the handler is valid in registry.
    function _isValid(address handler) internal view returns (bool result) {
        return IRegistry(_getRegistry()).isValid(handler);
    }

    function mintST(uint256 amount) public nonReentrant lock {
        require(amount > 0, "Skyrim: mintST amount is 0");

        uint256 _before = _DAIToken.balanceOf(address(this));
        _DAIToken.safeTransferFrom(msg.sender, address(this), amount);
        uint256 _after = _DAIToken.balanceOf(address(this));
        uint256 _amount = _after.sub(_before);

        _STToken.mint(msg.sender, _amount);
    }

    function mintJT(uint256 amount) public nonReentrant lock {
        require(amount > 0, "Skyrim: mintJT amount is 0");

        uint256 _before = _DAIToken.balanceOf(address(this));
        _DAIToken.safeTransferFrom(msg.sender, address(this), amount);
        uint256 _after = _DAIToken.balanceOf(address(this));
        uint256 _amount = _after.sub(_before);

        _JTToken.mint(msg.sender, _amount);
    }

    function investByST(uint256 amount) public nonReentrant lock {
        _investByST(amount);
    }

    function investByJT(uint256 amount) public nonReentrant lock {
        _investByJT(amount);
    }

    function withdrawByST(uint256 amount) public {
        require(amount > 0, "Skyrim: withdrawByST amount is 0");

        uint256 balance = _STToken.balanceOf(msg.sender);
        require(balance >= amount, "Skyrim: withdrawByST balance < amount");

        uint256 balanceOfThis = _DAIToken.balanceOf(address(this));
        require(balanceOfThis >= amount, "Skyrim: withdrawByST balanceOfThis < amount");

        _DAIToken.safeTransferFrom(address(this), msg.sender, amount);

        _STToken.burnFrom(msg.sender, amount);
    }

    function withdrawByJT(uint256 amount) public {
        require(amount > 0, "Skyrim: withdrawByJT amount is 0");

        uint256 balance = _JTToken.balanceOf(msg.sender);
        require(balance >= amount, "Skyrim: withdrawByJT balance < amount");

        uint256 balanceOfThis = _DAIToken.balanceOf(address(this));
        require(balanceOfThis >= amount, "Skyrim: withdrawByJT balanceOfThis < amount");

        _DAIToken.safeTransferFrom(address(this), msg.sender, amount);
        _JTToken.burnFrom(_msgSender(), amount);
    }

    function redeemWithST(uint256 amount) public {
        // _STInvestPool.redeem(amount);
        // _STToken.withdraw(amount);
    }

    function redeemWithJT(uint256 amount) public {
        // _JTInvestPool.redeem(amount);
        // _JTToken.withdrawRecord(amount);
    }

    function getSTInvestReward() public {
        _STInvestPoolReward.getReward();
    }

    function getJTInvestReward() public {
        _JTInvestPoolReward.getReward();
    }

    function stakeSTAndTRAPairPoolToken(uint256 amount) public {

    }

    function stakeJTAndTRAPairPoolToken(uint256 amount) public {

    }

    function stakeTRAAndDAIPairPoolToken(uint256 amount) public {

    }

    function withdrawSTAndTRALiquidityReward() public {

    }

    function withdrawJTAndTRALiquidityReward() public {

    }

    function withdrawTRAAndDAILiquidityReward() public {

    }

    /**
        Internals
     */
    function _investByST(uint256 amount) internal { 
        // Ensure deposit amount is not more than maximum
        require(
            amount >= MaxInvestBySTAmount && amount <= MaxInvestBySTAmount,
            "Skyrim: Deposit amount out of range"
        );

        _totalInvestByST = _totalInvestByST.add(amount);

        // Record investByST data for `msg.sender`
        investBySTInfos.push(
            InvestBySTInfo({
                amount: amount,
                active: true,
                finalSurplusIsNegative: false,
                finalSurplusAmount: 0,
                investTimestamp: block.timestamp
            })
        );

        _STToken.safeTransferFrom(msg.sender, address(this), amount);

        // Lend `amount` ST and DAI to money market
        _DAIToken.safeIncreaseAllowance(address(_investMarket), amount);
        _STToken.safeIncreaseAllowance(address(_investMarket), amount);

        _investMarket.depositWithST(amount);

        uint256 id = investBySTInfos.length;
        // Emit event
        emit EInvestByST(
            msg.sender,
            id,
            amount
        );
    }

    function _investByJT(uint256 amount) internal { 
        // Ensure deposit amount is not more than maximum
        require(
            amount >= MaxInvestByJTAmount && amount <= MaxInvestByJTAmount,
            "Skyrim: Deposit amount out of range"
        );

        _totalInvestByJT = _totalInvestByJT.add(amount);

        // Record deposit data for `msg.sender`
        investByJTInfos.push(
            InvestByJTInfo({
                amount: amount,
                active: true,
                finalSurplusIsNegative: false,
                finalSurplusAmount: 0,
                investTimestamp: block.timestamp
            })
        );

        _JTToken.safeTransferFrom(msg.sender, address(this), amount);

        // Lend `amount` ST to money market
        _DAIToken.safeIncreaseAllowance(address(_investMarket), amount);
        _JTToken.safeIncreaseAllowance(address(_investMarket), amount);

        _investMarket.depositWithJT(amount);

        uint256 id = investByJTInfos.length;
        // Emit event
        emit EInvestByJT(
            msg.sender,
            id,
            amount
        );
    }

    function setMinInvestBySTAmount(uint256 amount) public onlyOwner {
        MinInvestBySTAmount = amount;
    }

    function setMaxInvestBySTAmount(uint256 amount) public onlyOwner {
        MaxInvestBySTAmount = amount;
    }

    function setMinInvestByJTAmount(uint256 amount) public onlyOwner {
        MinInvestByJTAmount = amount;
    }

    function setMaxInvestByJTAmount(uint256 amount) public onlyOwner {
        MaxInvestByJTAmount = amount;
    }
}
